import React from 'react';
import '../css/About.css';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';
import Container from '@material-ui/core/Container';
import Avatar from '@material-ui/core/Avatar';

function About() {
  return (
    <div className="About">
      <header className="About-header">
        <Box display="flex" flexDirection="row">
          <Avatar src="/static/nateshim.png" alt = "sdfkj"></Avatar>
        </Box>
        <Container>
          <Typography>
            NATHANAEL SHIM
          </Typography>
        </Container>
        <Box>
          <Typography>Contact</Typography>
          <Typography>Email: nateshim@gmail.com</Typography>
          <Typography>Phone number: (510)-710-2091 </Typography>
          <Typography>Linkedin: https://www.linkedin.com/in/nathanael-shim-324b55115/</Typography>
        </Box>

      </header>
    </div>
  );
}

export default About;
